Artist: ISRAELIGHT; 
Title: ARISE & SHINE;
Date: 1977. 
From the liner notes: "This album is dedicated to all dozen of you who love Messianic Jewish Music.” 
Track Listing: Arise & Shine, God of Our Fathers, Ballad of 47th Street, Stand By Israel, Come Back People, I Will Call Upon the Lord, Trust in the Lord, Gospel of Peace, Come Unto Me, Now We Can Love + Shofar. These MP3s were digitized from original tapes from which the album was originally produced, so the music is clean and crisp. Download and Enjoy!

